def find_successful_party(n: int, m: int, friendships: list) -> list:
    """Finds a successful party configuration in the form of a clique or independent set of size 5.

    Args:
        n (int): Number of people.
        m (int): Number of friendships.
        friendships (list): List of tuples representing friendships.

    Returns:
        list: A list of 5 people forming a clique or independent set, or -1 if no such configuration exists.
    """
